import React from 'react';

function TaskList({tasks}) {
    return (
        <ul style={{ listStyleType: 'none', padding: 0}}>
            {tasks.map((task) => (
                <li key = {task.id}>
                    <h3>{task.title}</h3>
                    <p>{task.description}</p>
                    <p>{task.completed ? 'completed':'pending'}</p>
                </li>
            ))}
        </ul>
    );
}

export default TaskList;
